css:
@-moz-document domain("bazos.cz") {
body {
    background-color: #191919;
}

body p,
body b,
body i,
body span,
body h1,
body h2,
body h3,
body div,
body a,
body td,
body th,
body img {
    color: #ddd!important;
}

body .pridati,
button,
.inzeraty,
.galleryobal,
input[type="submit"],
body .barvalmenu,
body .barevne,
body form,
body .listainzerat,
#overlay > div {
    background-color: #282828;
    border-color: #383838;
    color: #ccc!important;
}

input[type="submit"]:active {
    background-color: #181818;
    border-color: #666;
}

input[type="submit"] {
    cursor: pointer;
}

.vysokoli * {
    color: black!important;
}

body .listah,
body .nadpismenu,
.galleryobal:hover,
.inzeraty:hover,
.cisla,
body .fucking-eu-cookies,
body .teldetail {
    background-color: #444;
    border-color: #555;
    color: #eee!important;
}

.dot {
    background: #ddd!important;
}

body .gallerylist {
    border: 1px transparent solid;
    border-radius: 3px;
}

body .gallerylista {
    border-color: #999;
    background-color: #555;
    border-radius: 3px;
}

body img[alt="List inzerátů"] {
    content: url("data:image/png;base64,");
}

body img[alt="Galerie"] {
    content: url("data:image/png;base64,");
}

.listalogol a img {
    max-width: 199px!important;
    max-height: 34px!important;
    width: 199px!important;
    height: 34px!important;
    content: url("data:image/png;base64,");
}
}
